// ("catac")
// >>> make_palindrome(("cata"))
// ("catac")
std::string make_palindrome(std::string string) {
    int n = string.size();
    int i = n - 1;
    while (i >= 0 && string[i] == string[n - 1 - i]) {
        --i;
