    std::string word;
    std::vector<std::string> words;
    while (ss >> word) {
        words.push_back(word);
    }
    for (auto& word : words) {
        std::sort(word.begin(), word.end());
    }
    std::stringstream result;
    for (const auto& word : words) {
        result << word << " ";
    }
    std::string result_str = result.str();
    result_str.pop_back();
