// Given a vector of integers, sort the integers that are between 1 and 9 inclusive,
// reverse the resulting vector, and then replace each digit by its corresponding name from
// "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine".
// For example:
// >>> by_length((std::vector<long>({(long)2, (long)1, (long)1, (long)4, (long)5, (long)8, (long)2, (long)3})))
// (std::vector<std::string>({(std::string)"Eight", (std::string)"Five", (std::string)"Four", (std::string)"Three", (std::string)"Two", (std::string)"Two", (std::string)"One", (std::string)"One"}))
// If the vector is empty, return an empty vector:
// >>> by_length((std::vector<long>()))
// (std::vector<std::string>())
// If the vector has any strange number ignore it:
// >>> by_length((std::vector<long>({(long)1, (long)-1, (long)55})))
// (std::vector<std::string>({(std::string)"One"}))
std::vector<std::string> by_length(std::vector<long> arr) {
    std::vector<std::string> result;
    std::vector<long> temp;
    for (long i : arr) {
        if (i >= 1 && i <= 9) {
            temp.push_back(i);
        }
    }
    std::sort(temp.begin(), temp.end());
    std::reverse(temp.begin(), temp.end());
    std::map<long, std::string> m = {{1, "One"}, {2, "Two"}, {3, "Three"}, {4, "Four"}, {5, "Five"}, {6, "Six"}, {7, "Seven"}, {8, "Eight"}, {9, "Nine"}};
    for (long i : temp) {
        result.push_back(m[i]);
    }
    return result;

